import React from 'react'
import { Container, Form, Card } from "react-bootstrap"


const Auth = () => {
  return (
    <Container
      className="d-flex justify-content-center align-items-center"
      style={{
        height: window.innerHeight - 54
      }}>

      <Card style={{
        width: 600
      }} className="p-5">
        <h2 className="m-auto">Авторизация</h2>
        <Form></Form>
      </Card>

    </Container>
  )
}

export default Auth
